import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Asegúrate de tener los estilos en este archivo

const Navbar = () => {
  const [subMenu, setSubMenu] = useState(null);

  const handleMouseEnter = (menu) => {
    setSubMenu(menu);
  };

  const handleMouseLeave = () => {
    setSubMenu(null);
  };

  return (
    <nav className="navbar">
      <div className="logo">
        <img src="tu-logo.png" alt="Logo" />
        <h1>Título de la Página</h1>
      </div>
      <ul className="nav-links">
        <li onMouseEnter={() => handleMouseEnter('luz')} onMouseLeave={handleMouseLeave}>
          <Link to="/luz">Arrojando Luz sobre PACE</Link>
          {subMenu === 'luz' && (
            <ul className="sub-menu">
              <li><Link to="/seccion1">Sección I: Propiedades fundamentales de la luz</Link></li>
              <li><Link to="/seccion2">Sección II: ¿Qué determina el color que vemos?</Link></li>
              <li><Link to="/seccion3">Sección III: ¿Cómo interactúa la atmósfera con la luz?</Link></li>
              <li><Link to="/seccion4">Sección IV: ¿Cómo interactúa el océano con la luz?</Link></li>
              <li><Link to="/todo-suma">PACE - ¡TODO SUMA!</Link></li>
            </ul>
          )}
        </li>
        <li onMouseEnter={() => handleMouseEnter('datos')} onMouseLeave={handleMouseLeave}>
          <Link to="/datos">Acceso a los datos de PACE</Link>
          {subMenu === 'datos' && (
            <ul className="sub-menu">
              <li><Link to="/recursos-datos">Recursos de datos de PACE</Link></li>
              <li><Link to="/opciones-acceso">Opciones para acceder a los datos de PACE</Link></li>
              <li><Link to="/nivel-madurez">Acceso por nivel de madurez</Link></li>
              <li><Link to="/productos-derivados">Productos derivados adicionales</Link></li>
            </ul>
          )}
        </li>
        <li onMouseEnter={() => handleMouseEnter('fitoplancton')} onMouseLeave={handleMouseLeave}>
          <Link to="/fitoplancton">Exploración del fitoplancton</Link>
          {subMenu === 'fitoplancton' && (
            <ul className="sub-menu">
              <li><Link to="/fitopia">Fitopia</Link></li>
              <li><Link to="/exploracion">Exploración del fitoplancton</Link></li>
              <li><Link to="/tutoriales">Tutoriales y recursos</Link></li>
              <li><Link to="/chlorophyll">NASA's long-term chlorophyll record is unparalleled</Link></li>
            </ul>
          )}
        </li>
        <li onMouseEnter={() => handleMouseEnter('ritmo')} onMouseLeave={handleMouseLeave}>
          <Link to="/ritmo">¡Construye tu propio RITMO!</Link>
          {subMenu === 'ritmo' && (
            <ul className="sub-menu">
              <li><Link to="/instrucciones">Instrucciones y plantilla</Link></li>
            </ul>
          )}
        </li>
        <li onMouseEnter={() => handleMouseEnter('necesitamos')} onMouseLeave={handleMouseLeave}>
          <Link to="/necesitamos">¿Por qué necesitamos PACE?</Link>
          {subMenu === 'necesitamos' && (
            <ul className="sub-menu">
              <li><Link to="/ecologia">Ecología oceánica</Link></li>
            </ul>
          )}
        </li>
        <li><Link to="/noticias">Nuestras últimas noticias</Link></li>
        <li><Link to="/mapas">Mapas de historias y folletos electrónicos de PCE</Link></li>
        <li><Link to="/galeria">Galería de medios</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
